import React,{ Component } from 'react';
import { Link } from 'react-router-dom';
import gdsicon from './../img/gdsicon.png';
class Login extends Component {
    render() {
        return(
            <div className="wrap"><div className="container">
                <div className="login">
                    <div className="title">
                        <p className="text-center">GDS Agent App</p>
                    </div>
                    <div className="form-content">
                        <div className="logo">
                            <img src={gdsicon} alt="GDS"/>
                        </div>
                        <button className="btn-com"><Link to="/signup" className="cl-white" value="dashboard">Login</Link></button>
                        <button className="btn-com">Signup</button>
                    </div>
                </div>
            </div>
            </div>
        );
    }
}
export default Login;
